class Solution:
    def numSimilarGroups(self, A):
        """
        :type A: List[str]
        :rtype: int
        """
        res = 0
        n = len(A[0])
        A = set(A)
        while A:
            q = [A.pop()]
            i = 0
            while i < len(q):
                cur = q[i]
                i += 1
                for next in list(A):
                    count = 0
                    for j in range(n):
                        if cur[j] != next[j]:
                            count += 1
                            if count > 2:
                                break
                    if count == 2:
                        q.append(next)
                        A.remove(next)
            res += 1
        return res
        
